import React from "react";
import './skills.css';

const Skills = ()=>{
    return(
        <section id="ski">
            <span className="skilhead">What I do</span>
            <span className="skildesc">I do website development with UI friendly platforms</span>
            <div>
                <span className="skillbar"></span>
            </div>
        </section>
    );
}

export default Skills;
